import {  } from "../types";



export const currentSong = (
  state: Song | {} = {},
  action: ChangeSongAction
) => {
  switch (action.type) {
    case CHANGE_SONG: {
      return action.payload;
    }
    default: {
      return state;
    }
  }
};

export {};
